document.interval_ids=setInterval(()=>{
    // 定时发送get请求，并且将结果push进datas
    if(document.pause_flag){
        return;
    }
    if(document.datas.length==document.max_num){
        document.pause_flag=true;
        clearInterval(document.interval_ids);
    }
    if(document.parms.length==0){
        return;
    }
    parm=document.parms.pop();
    // https://jiaotong.baidu.com/trafficindex/overview/hisarealist?startDay=20240506&endDay=20240507&cityCode=119&type=3&stdTag=3,4,5,6&index=1
    url=`https://jiaotong.baidu.com/trafficindex/overview/hisarealist?startDay=${parm[1]}&endDay=${parm[2]}&cityCode=${parm[0]}&type=3&stdTag=3,4,5,6&index=1`;
    $.get(url,(data)=>{
        document.datas.push({"data":data,"parm":parm});
    })});

